CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `m_v_balance` AS select `m_customer`.`id` AS `id`,(select coalesce(sum(`m_topup`.`value_total`),0) from `m_topup` where `m_topup`.`id_customer` = `m_customer`.`id` and `m_topup`.`status` = 1 limit 1) AS `topup`,(select coalesce(sum(`m_buy`.`total`),0) from `m_buy` where `m_buy`.`id_customer` = `m_customer`.`id` and `m_buy`.`status` = 1 limit 1) AS `buy`,(select coalesce(sum(`m_buy`.`value_total`),0) from `m_buy` where `m_buy`.`id_customer` = `m_customer`.`id` and `m_buy`.`status` = 1 limit 1) AS `buy_nopromo`,(select coalesce(sum(`m_buy`.`total_coin`),0) from `m_buy` where `m_buy`.`id_customer` = `m_customer`.`id` and `m_buy`.`status` = 1 limit 1) AS `buy_coin`,(select coalesce(sum(`m_withdraw`.`value_total`),0) from `m_withdraw` where `m_withdraw`.`id_customer` = `m_customer`.`id` and `m_withdraw`.`status` <> 5 limit 1) AS `withdraw`,(select coalesce(sum(`m_withdraw`.`value_total`),0) from `m_withdraw` where `m_withdraw`.`id_customer` = `m_customer`.`id` and (`m_withdraw`.`status` = 1 or `m_withdraw`.`status` = 3) limit 1) AS `withdraw_approve`,(select coalesce(sum(`m_transfer`.`total`),0) from `m_transfer` where `m_transfer`.`from_customer` = `m_customer`.`id` and `m_transfer`.`status` = 1 limit 1) AS `transfer_min`,(select coalesce(sum(`m_transfer`.`total`),0) from `m_transfer` where `m_transfer`.`to_customer` = `m_customer`.`id` and `m_transfer`.`status` = 1 limit 1) AS `transfer_plus`,(select coalesce(sum(`m_buy_ref`.`total`),0) from `m_buy_ref` where `m_buy_ref`.`to_customer` = `m_customer`.`id` limit 1) AS `buy_ref`,(select count(`k`.`id`) AS `total` from `m_buy` `k` where `k`.`id_customer` = `m_customer`.`id`) AS `ref_count`,(select count(`bu`.`id`) from (`m_buy` `bu` join `m_customer` `rs` on(`rs`.`id` = `bu`.`id_customer`)) where `rs`.`refferal` = `m_customer`.`id` limit 1) AS `refs`,(select count(`k`.`id`) AS `total` from `m_customer` `k` where `k`.`refferal` = `m_customer`.`id`) AS `ref_count_all`,(select coalesce(sum(`m_deduction`.`total`),0) from `m_deduction` where `m_deduction`.`id_customer` = `m_customer`.`id` limit 1) AS `deduction`,(select coalesce(sum(`m_task_reward`.`rewards`),0) from `m_task_reward` where `m_task_reward`.`id_customer` = `m_customer`.`id` and `m_task_reward`.`status` = 1 limit 1) AS `rewards`,(select coalesce(count(`m_task_reward`.`id`),0) from `m_task_reward` where `m_task_reward`.`id_customer` = `m_customer`.`id` and `m_task_reward`.`status` = 1 limit 1) AS `total_task`,(select coalesce(sum(`m_refferal_reward`.`rewards`),0) from `m_refferal_reward` where `m_refferal_reward`.`to_users` = `m_customer`.`id` limit 1) AS `refferal_reward`,(select coalesce(sum(`m_vote_reward`.`reward`),0) from `m_vote_reward` where `m_vote_reward`.`id_customer` = `m_customer`.`id` limit 1) AS `vote_reward`,(select coalesce(sum(`m_addtional`.`amount`),0) from `m_addtional` where `m_addtional`.`id_customer` = `m_customer`.`id` limit 1) AS `additional` from `m_customer`;

