(1,	'Sospawn',	'Logo-SOSPAWN-1.png',	'favicon(2).png',	'SOSP',	155000.0000,	10000.0000,	100000,	10000,	50000,	'hai@sospawn.com',	'hai@sospawn.com',	'<p>email: <strong><a href=\"mailto:cs@sospawn.xyz\">admin@sospawn.com</a></strong></p>\r\n\r\n<p>Telegram:&nbsp;<strong><a href=\"https://t.me/sospawn\">https://t.me/sospawn</a></strong></p>\r\n',	'<p><strong>SOSPAWN </strong>adalah tools untuk meningkatkan pertumbuhan user sangat&nbsp;cepat dengan memberikan hadiah poin, kupon cashback, diskon, hadiah, dan penawaran untuk segala jenis tujuan bisnis untuk meningkatkan keterlibatan oleh keanggotaan loyalitas. Ini adalah SAAS (<strong>Software as a Service</strong>)&nbsp;berdasarkan Aplikasi untuk menghasilkan viralitas popularitas merek yang meningkatkan pendapatan dan cara tercepat untuk mendapatkan akuisisi pengguna baru.</p>\r\n\r\n<p><strong>Fitur Keterlibatan Pengguna:</strong></p>\r\n\r\n<ul>\r\n	<li>POIN &ndash; memicu pengguna untuk menggunakan aplikasi dengan memberikan poin untuk ditukarkan</li>\r\n	<li>HADIAH &ndash; tingkatkan retensi transaksi untuk membangun loyalitas terkuat pengguna</li>\r\n	<li>CASHBACK &ndash; meningkatkan penjualan dan konversi pengguna menjadi pelanggan</li>\r\n	<li>KUPON &ndash; memberikan diskon tambahan untuk pembelian berulang</li>\r\n	<li>DISKON &ndash; menghasilkan lebih banyak transaksi dengan memberikan pelanggan diskon untuk produk khusus</li>\r\n	<li>HADIAH &ndash; menciptakan kesadaran merek dan akuisisi baru</li>\r\n	<li>DEALS &ndash; memberikan beberapa fasilitas untuk meningkatkan loyalitas keanggotaan</li>\r\n	<li>VOUCHER - buat harga pintu untuk pengguna acak untuk memicu pelanggan aktif di aplikasi setiap hari</li>\r\n</ul>\r\n\r\n<p><strong>Layanan yang kami berikan kepada Client kami:</strong></p>\r\n\r\n<ul>\r\n	<li>Apps Installation&nbsp;</li>\r\n	<li>KYC&nbsp;</li>\r\n	<li>Reporting&nbsp;</li>\r\n	<li>Following&nbsp;</li>\r\n	<li>Subsription&nbsp;</li>\r\n	<li>Verification&nbsp;</li>\r\n	<li>Survey&nbsp;</li>\r\n	<li>Sign up</li>\r\n</ul>\r\n',	'<h4>Syarat &amp; Ketentuan</h4>\r\n\r\n<p>Diperbarui pada 09-02-2023</p>\r\n\r\n<h4>Ketentuan Umum</h4>\r\n\r\n<p>Dengan mengakses dan melakukan pemesanan dengan Sospawn, Anda mengonfirmasi bahwa Anda menyetujui dan terikat dengan ketentuan layanan yang terdapat dalam Syarat &amp; Ketentuan yang diuraikan di bawah ini. Persyaratan ini berlaku untuk seluruh situs web dan semua email atau jenis komunikasi lainnya antara Anda dan Sospawn.</p>\r\n\r\n<p>Dalam keadaan apa pun, tim Sospawn tidak bertanggung jawab atas kerugian langsung, tidak langsung, khusus, insidental, atau konsekuensial, termasuk, namun tidak terbatas pada, hilangnya data atau keuntungan, yang timbul dari penggunaan, atau ketidakmampuan untuk menggunakan, materi di situs ini, meskipun tim Sospawn atau perwakilan resmi telah diberi tahu tentang kemungkinan kerusakan tersebut. Jika penggunaan Anda atas materi dari situs ini mengakibatkan perlunya servis, perbaikan, atau koreksi peralatan atau data, Anda menanggung semua biayanya.</p>\r\n\r\n<p>Sospawn tidak akan bertanggung jawab atas hasil apa pun yang mungkin terjadi selama penggunaan sumber daya kami. Kami berhak mengubah harga dan merevisi kebijakan penggunaan sumber daya kapan saja. Syarat &amp; Ketentuan ini dibuat dengan <a href=\"https://termify.io\" target=\"_blank\">Termify</a>.</p>\r\n\r\n<h4>Lisensi</h4>\r\n\r\n<p>Sospawn memberi Anda lisensi terbatas yang dapat dibatalkan, tidak eksklusif, tidak dapat dialihkan, untuk mengunduh, memasang, dan menggunakan aplikasi secara ketat sesuai dengan ketentuan Perjanjian ini.</p>\r\n\r\n<p>Syarat &amp; Ketentuan ini adalah kontrak antara Anda dan Sospawn (disebut dalam Syarat &amp; Ketentuan ini sebagai &quot;Sospawn&quot;, &quot;kami&quot;, &quot;kami&quot; atau &quot;milik kami&quot;), penyedia situs web Sospawn dan layanan yang dapat diakses dari situs web Sospawn (yang secara bersama-sama disebut dalam Syarat &amp; Ketentuan ini sebagai &quot;Layanan Sospawn&quot;