Situs Sospawn, yang dapat diakses melalui URL ini:</li>\r\n	<li>Anda: seseorang atau entitas yang terdaftar di Sospawn untuk menggunakan Layanan.</li>\r\n</ul>\r\n\r\n<h4>Batasan</h4>\r\n\r\n<p>Anda setuju untuk tidak melakukannya, dan Anda tidak akan mengizinkan orang lain untuk:</p>\r\n\r\n<ul>\r\n	<li>Melisensikan, menjual, menyewakan, menyewakan, menugaskan, mendistribusikan, mentransmisikan, menghosting, melakukan outsourcing, mengungkapkan, atau mengeksploitasi aplikasi secara komersial atau membuat platform tersedia untuk pihak ketiga mana pun.</li>\r\n	<li>Memodifikasi, membuat karya turunan, membongkar, mendekripsi, mengompilasi balik, atau merekayasa balik bagian mana pun dari aplikasi.</li>\r\n	<li>Hapus, ubah, atau sembunyikan pemberitahuan hak milik apa pun (termasuk pemberitahuan hak cipta atau merek dagang apa pun) dari Sospawn atau afiliasinya, mitra, pemasok, atau pemberi lisensi aplikasi.</li>\r\n</ul>\r\n\r\n<h4>Kebijakan Pengembalian Barang dan Pengembalian Dana</h4>\r\n\r\n<p>Terima kasih telah berbelanja di Sospawn. Kami menghargai kenyataan bahwa Anda suka membeli barang yang kami buat. Kami juga ingin memastikan Anda mendapatkan pengalaman yang bermanfaat saat menjelajahi, mengevaluasi, dan membeli produk kami.</p>\r\n\r\n<p>Sama seperti pengalaman berbelanja lainnya, ada syarat dan ketentuan yang berlaku untuk transaksi di Sospawn. Kami akan sesingkat yang diizinkan oleh pengacara kami. Hal utama yang harus diingat adalah bahwa dengan melakukan pemesanan atau melakukan pembelian di Sospawn, Anda menyetujui persyaratan beserta Kebijakan Privasi&nbsp;Sospawn.</p>\r\n\r\n<p>Jika, karena alasan apa pun, Anda tidak sepenuhnya puas dengan barang atau layanan apa pun yang kami sediakan, jangan ragu untuk menghubungi kami dan kami akan mendiskusikan masalah apa pun yang Anda alami dengan produk kami.</p>\r\n\r\n<h4>Saran Anda</h4>\r\n\r\n<p>Setiap umpan balik, komentar, ide, peningkatan, atau saran (secara kolektif, &quot;Saran&quot;) yang Anda berikan kepada Sospawn sehubungan dengan aplikasi akan tetap menjadi milik tunggal dan eksklusif Sospawn.</p>\r\n\r\n<p>Sospawn bebas menggunakan, menyalin, memodifikasi, menerbitkan, atau mendistribusikan ulang Saran untuk tujuan apa pun dan dengan cara apa pun tanpa kredit atau kompensasi apa pun kepada Anda.</p>\r\n\r\n<h4>Persetujuan Anda</h4>\r\n\r\n<p>Kami telah memperbarui&nbsp;Persyaratan &amp; Ketentuan&nbsp;kami untuk memberi Anda transparansi lengkap tentang apa yang disetel saat Anda mengunjungi situs kami dan cara penggunaannya. Dengan menggunakan aplikasi kami, mendaftarkan akun, atau melakukan pembelian, Anda dengan ini menyetujui Persyaratan &amp; Ketentuan kami.</p>\r\n\r\n<h4>Tautan ke Situs Web Lain</h4>\r\n\r\n<p>Persyaratan &amp; Ketentuan ini hanya berlaku untuk Layanan. Layanan mungkin berisi tautan ke situs web lain yang tidak dioperasikan atau dikendalikan oleh Sospawn. Kami tidak bertanggung jawab atas konten, keakuratan, atau pendapat yang diungkapkan di situs web tersebut, dan situs web tersebut tidak diselidiki, dipantau, atau diperiksa keakuratan atau kelengkapannya oleh kami. Harap diingat bahwa ketika Anda menggunakan tautan untuk beralih dari Layanan ke situs web lain, Syarat &amp; Ketentuan kami tidak berlaku lagi. Penjelajahan dan interaksi Anda di situs web lain mana pun, termasuk yang memiliki tautan di platform kami, tunduk pada aturan dan kebijakan situs web itu sendiri. Pihak ketiga tersebut dapat menggunakan cookie mereka sendiri atau metode lain untuk mengumpulkan informasi tentang Anda.</p>\r\n\r\n<h4>Cookie</h4>\r\n\r\n<p>Sospawn menggunakan &quot;Cookies&quot; untuk mengidentifikasi area situs web kami yang telah Anda kunjungi. Cookie adalah sepotong kecil data yang disimpan di komputer atau perangkat seluler Anda oleh browser web Anda. Kami menggunakan Cookie untuk meningkatkan kinerja dan fungsionalitas aplikasi kami, tetapi tidak penting untuk penggunaannya. Namun, tanpa cookie ini, fungsi tertentu seperti video mungkin menjadi tidak tersedia atau Anda akan diminta untuk memasukkan detail login Anda setiap kali mengunjungi aplikasi karena kami tidak dapat mengingat bahwa Anda telah login sebelumnya. Sebagian besar browser web dapat diatur untuk menonaktifkan penggunaan Cookie. Namun, jika Anda menonaktifkan Cookie, Anda mungkin tidak dapat mengakses fungsionalitas di situs web kami dengan benar atau sama sekali. Kami tidak pernah menempatkan Informasi Identifikasi Pribadi di Cookies.</p>\r\n\r\n<h4>Perubahan Syarat &amp; Ketentuan Kami</h4>\r\n\r\n<p>Anda mengetahui dan menyetujui bahwa <!--?=Sospawn;?--> dapat berhenti (secara permanen atau sementara) menyediakan Layanan (atau fitur apa pun dalam Layanan) kepada Anda atau pengguna secara umum di <!--?=Sospawn;?--> satu-satunya kebijaksanaan, tanpa pemberitahuan sebelumnya kepada Anda. Anda dapat berhenti menggunakan Layanan kapan saja. Anda tidak perlu memberi tahu secara spesifik <!--?=Sospawn;?--> saat Anda berhenti menggunakan Layanan. Anda mengakui dan setuju bahwa jika <!--?=Sospawn;?--> menonaktifkan akses ke akun Anda, Anda mungkin dicegah untuk mengakses Layanan, detail akun Anda atau file apa pun atau materi lain yang terdapat di akun Anda.</p>\r\n\r\n<p>Jika kami memutuskan untuk mengubah Persyaratan &amp; Ketentuan kami, kami akan memposting perubahan tersebut di halaman ini, dan/atau memperbarui tanggal modifikasi Persyaratan &amp; Ketentuan di bawah.</p>\r\n\r\n<h4>Modifikasi pada aplikasi Kami</h4>\r\n\r\n<p>Sospawn berhak mengubah, menangguhkan, atau menghentikan, untuk sementara atau selamanya, aplikasi atau layanan apa pun yang terhubung dengannya, dengan atau tanpa pemberitahuan dan tanpa tanggung jawab kepada Anda.</p>\r\n\r\n<h4>Pembaruan pada aplikasi Kami</h4>\r\n\r\n<p>Sospawn dari waktu ke waktu dapat memberikan penyempurnaan atau peningkatan pada fitur/fungsi aplikasi, yang dapat mencakup tambalan, perbaikan bug, pembaruan, peningkatan, dan modifikasi lainnya (&quot;Pembaruan&quot;).</p>\r\n\r\n<p>Pembaruan dapat mengubah atau menghapus fitur dan/atau fungsi tertentu dari aplikasi. Anda setuju bahwa Sospawn tidak berkewajiban untuk (i) memberikan Pembaruan apa pun, atau (ii) terus menyediakan atau mengaktifkan fitur dan/atau fungsi aplikasi tertentu apa pun kepada Anda.</p>\r\n\r\n<p>Anda selanjutnya setuju bahwa semua Pembaruan akan (i) dianggap sebagai bagian integral dari aplikasi, dan (ii) tunduk pada syarat dan ketentuan Perjanjian ini.</p>\r\n\r\n<h4>Layanan Pihak Ketiga</h4>\r\n\r\n<p>Kami dapat menampilkan, menyertakan, atau menyediakan konten pihak ketiga (termasuk data, informasi, aplikasi, dan layanan produk lainnya) atau menyediakan tautan ke situs web atau layanan pihak ketiga (&quot;Layanan Pihak Ketiga&quot;).</p>\r\n\r\n<p>Anda mengetahui dan menyetujui bahwa Sospawn tidak bertanggung jawab atas Layanan Pihak Ketiga mana pun, termasuk keakuratan, kelengkapan, ketepatan waktu, validitas, kepatuhan hak cipta, legalitas, kesopanan, kualitas, atau aspek lainnya. Sospawn tidak berasumsi dan tidak akan memiliki kewajiban atau tanggung jawab apa pun kepada Anda atau orang atau entitas lain mana pun untuk Layanan Pihak Ketiga apa pun.</p>\r\n\r\n<p>Layanan Pihak Ketiga dan tautannya disediakan semata-mata untuk kenyamanan Anda dan Anda mengakses dan menggunakannya sepenuhnya atas risiko Anda sendiri dan tunduk pada persyaratan dan ketentuan pihak ketiga tersebut.</p>\r\n\r\n<h4>Jangka Waktu dan Pengakhiran</h4>\r\n\r\n<p>Perjanjian ini akan tetap berlaku hingga diakhiri oleh Anda atau Sospawn.</p>\r\n\r\n<p>Sospawn dapat, atas kebijakannya sendiri, kapan saja dan untuk alasan apa pun atau tanpa alasan, menangguhkan atau menghentikan Perjanjian ini dengan atau tanpa pemberitahuan sebelumnya.</p>\r\n\r\n<p>Perjanjian ini akan segera diakhiri, tanpa pemberitahuan sebelumnya dari Sospawn, jika Anda gagal mematuhi ketentuan mana pun dari Perjanjian ini. Anda juga dapat menghentikan Perjanjian ini dengan menghapus aplikasi dan semua salinannya dari komputer Anda.</p>\r\n\r\n<p>Setelah penghentian Perjanjian ini, Anda harus menghentikan semua penggunaan aplikasi dan menghapus semua salinan aplikasi dari komputer Anda.</p>\r\n\r\n<p>Pengakhiran Perjanjian ini tidak akan membatasi hak atau pemulihan Sospawn apa pun secara hukum atau keadilan jika Anda melanggar (selama jangka waktu Perjanjian ini) kewajiban Anda berdasarkan Perjanjian ini.</p>\r\n\r\n<h4>Pemberitahuan Pelanggaran Hak Cipta</h4>\r\n\r\n<p>Jika Anda adalah pemilik hak cipta atau agen pemilik tersebut dan yakin bahwa materi apa pun di aplikasi kami merupakan pelanggaran hak cipta Anda, silakan hubungi kami dengan mencantumkan informasi berikut: (a) tanda tangan fisik atau elektronik dari pemilik hak cipta atau orang yang berwenang untuk bertindak atas namanya; (b) identifikasi materi yang diklaim melanggar; (c) informasi kontak Anda, termasuk alamat, nomor telepon, dan email Anda; (d) pernyataan oleh Anda bahwa Anda memiliki keyakinan dengan itikad baik bahwa penggunaan materi tersebut tidak diizinkan oleh pemilik hak cipta; dan (e) pernyataan bahwa informasi dalam pemberitahuan itu akurat, dan, di bawah hukuman sumpah palsu, Anda berwenang untuk bertindak atas nama pemilik.</p>\r\n\r\n<h4>Ganti Rugi</h4>\r\n\r\n<p>Anda setuju untuk mengganti rugi dan membebaskan Sospawn dan perusahaan induknya, anak perusahaan, afiliasi, pejabat, karyawan, agen, mitra, dan pemberi lisensinya (jika ada) dari klaim atau permintaan apa pun, termasuk biaya pengacara yang wajar, karena atau yang timbul dari Anda: (a) penggunaan aplikasi; (b) pelanggaran terhadap Perjanjian ini atau hukum atau peraturan apa pun; atau (c) pelanggaran hak apa pun dari pihak ketiga.</p>\r\n\r\n<h4>Tanpa Jaminan</h4>\r\n\r\n<p>Aplikasi ini disediakan untuk Anda &quot;SEBAGAIMANA ADANYA&quot; dan &quot;SEBAGAIMANA TERSEDIA&quot; dan dengan semua kesalahan dan cacat tanpa jaminan apa pun. Sejauh yang diizinkan oleh undang-undang yang berlaku, Sospawn, atas namanya sendiri dan atas nama afiliasinya serta pemberi lisensi dan penyedia layanannya masing-masing, secara tegas menolak semua jaminan, baik tersurat, tersirat, menurut undang-undang atau lainnya, sehubungan dengan aplikasi , termasuk semua jaminan tersirat tentang kelayakan untuk diperdagangkan, kesesuaian untuk tujuan tertentu, kepemilikan dan non-pelanggaran, dan jaminan yang mungkin timbul dari proses transaksi, pelaksanaan kinerja, penggunaan atau praktik perdagangan. Tanpa membatasi hal tersebut di atas, Sospawn tidak memberikan jaminan atau janji, dan tidak membuat representasi apa pun bahwa aplikasi akan memenuhi kebutuhan Anda, mencapai hasil yang diinginkan, kompatibel atau bekerja dengan perangkat lunak lain, sistem atau layanan, beroperasi tanpa gangguan , memenuhi standar kinerja atau keandalan apa pun atau bebas dari kesalahan atau kesalahan atau cacat apa pun dapat atau akan diperbaiki.</p>\r\n\r\n<p>Tanpa membatasi hal tersebut di atas, baik Sospawn maupun penyedia Sospawn mana pun membuat pernyataan atau jaminan apa pun, tersurat maupun tersirat: (i) mengenai pengoperasian atau ketersediaan aplikasi, atau informasi, konten, dan materi atau produk termasuk di atasnya; (ii) bahwa aplikasi tidak akan terganggu atau bebas kesalahan; (iii) mengenai keakuratan, keandalan, atau mata uang dari setiap informasi atau konten yang disediakan melalui aplikasi; atau (iv) bahwa aplikasi, servernya, konten, atau email yang dikirim dari atau atas nama Sospawn bebas dari virus, skrip, trojan horse, worm, malware, bom waktu, atau komponen berbahaya lainnya.</p>\r\n\r\n<p>Beberapa yurisdiksi tidak mengizinkan pengecualian atau pembatasan pada jaminan tersirat atau pembatasan hak hukum konsumen yang berlaku, sehingga beberapa atau semua pengecualian dan pembatasan di atas mungkin tidak berlaku untuk Anda.</p>\r\n\r\n<h4>Batasan Tanggung Jawab</h4>\r\n\r\n<p>Terlepas dari kerugian apa pun yang mungkin Anda tanggung, seluruh tanggung jawab Sospawn dan pemasoknya di bawah ketentuan apa pun dalam Perjanjian ini dan ganti rugi eksklusif Anda untuk semua hal di atas akan terbatas pada jumlah yang sebenarnya Anda bayarkan untuk aplikasi tersebut.</p>\r\n\r\n<p>Sejauh yang diizinkan oleh undang-undang yang berlaku, dalam keadaan apa pun Sospawn atau pemasoknya tidak akan bertanggung jawab atas kerugian khusus, insidental, tidak langsung, atau konsekuensial apa pun (termasuk, namun tidak terbatas pada, kerugian atas hilangnya keuntungan, atas kerugian data atau informasi lainnya, untuk gangguan bisnis, untuk cedera pribadi, untuk hilangnya privasi yang timbul dari atau dengan cara apa pun terkait dengan penggunaan atau ketidakmampuan untuk menggunakan aplikasi, perangkat lunak pihak ketiga dan/atau perangkat keras pihak ketiga yang digunakan dengan aplikasi, atau sehubungan dengan ketentuan apa pun dalam Perjanjian ini), bahkan jika Sospawn atau pemasok mana pun telah diberi tahu tentang kemungkinan kerusakan tersebut dan bahkan jika pemulihan gagal dari tujuan utamanya.</p>\r\n\r\n<p>Beberapa negara bagian/yurisdiksi tidak mengizinkan pengecualian atau pembatasan kerugian insidental atau konsekuensial, sehingga pembatasan atau pengecualian di atas mungkin tidak berlaku untuk Anda.</p>\r\n\r\n<h4>Keterpisahan</h4>\r\n\r\n<p>Jika ada ketentuan dalam Perjanjian ini yang dianggap tidak dapat dilaksanakan atau tidak sah, ketentuan tersebut akan diubah dan ditafsirkan untuk mencapai tujuan ketentuan tersebut semaksimal mungkin berdasarkan hukum yang berlaku dan ketentuan lainnya akan terus berlaku sepenuhnya .</p>\r\n\r\n<p>Perjanjian ini, bersama dengan Kebijakan Privasi dan pemberitahuan hukum lainnya yang diterbitkan oleh Sospawn di Layanan, merupakan keseluruhan perjanjian antara Anda dan Sospawn terkait Layanan. Jika ada ketentuan dalam Perjanjian ini yang dianggap tidak sah oleh pengadilan dengan yurisdiksi yang kompeten, ketidakabsahan ketentuan tersebut tidak akan mempengaruhi keabsahan ketentuan lainnya dalam Perjanjian ini, yang akan tetap berlaku sepenuhnya. Tidak ada pengabaian ketentuan apa pun dalam Perjanjian ini yang dianggap sebagai pengabaian lebih lanjut atau berkelanjutan dari ketentuan tersebut atau ketentuan lainnya, dan kegagalan Sospawn untuk menegaskan hak atau ketentuan apa pun berdasarkan Perjanjian ini bukan merupakan pengabaian hak atau ketentuan tersebut. ANDA DAN Sospawn SETUJU BAHWA SETIAP PENYEBAB TINDAKAN YANG TIMBUL DARI ATAU TERKAIT DENGAN LAYANAN HARUS DIMULAI DALAM SATU (1) TAHUN SETELAH PENYEBAB TINDAKAN TERJADI. LAINNYA, PENYEBAB TINDAKAN TERSEBUT DILARANG SECARA PERMANEN.</p>\r\n\r\n<h4>Pembebasan</h4>\r\n\r\n<p>Kecuali seperti yang ditentukan di sini, kegagalan untuk melaksanakan hak atau mewajibkan pelaksanaan kewajiban berdasarkan Perjanjian ini tidak akan memengaruhi kemampuan salah satu pihak untuk melaksanakan hak tersebut atau mewajibkan pelaksanaan tersebut kapan pun setelahnya dan juga tidak akan menjadi pengesampingan atas pelanggaran merupakan pengabaian atas pelanggaran berikutnya.</p>\r\n\r\n<p>o kegagalan untuk melaksanakan, dan tidak ada penundaan dalam pelaksanaan, di pihak salah satu pihak, hak atau kekuasaan apa pun berdasarkan Perjanjian ini akan berlaku sebagai pengesampingan hak atau kekuasaan tersebut. Juga tidak ada pelaksanaan tunggal atau sebagian dari hak atau kekuasaan apa pun berdasarkan Perjanjian ini yang menghalangi pelaksanaan lebih lanjut dari hak tersebut atau hak lain yang diberikan di sini. Jika terjadi pertentangan antara Perjanjian ini dan pembelian yang berlaku atau persyaratan lainnya, persyaratan Perjanjian ini yang akan berlaku.</p>\r\n\r\n<h4>Amandemen Perjanjian ini</h4>\r\n\r\n<p>Sospawn berhak, atas kebijakannya sendiri, untuk mengubah atau mengganti Perjanjian ini kapan saja. Jika revisi penting, kami akan memberikan pemberitahuan setidaknya 30 hari sebelum ketentuan baru mulai berlaku. Apa yang merupakan perubahan materi akan ditentukan atas kebijakan kami sendiri.</p>\r\n\r\n<p>Dengan terus mengakses atau menggunakan aplikasi kami setelah revisi berlaku, Anda setuju untuk terikat dengan persyaratan yang direvisi. Jika Anda tidak menyetujui persyaratan baru, Anda tidak lagi diizinkan untuk menggunakan Sospawn.</p>\r\n\r\n<h4>Seluruh Perjanjian</h4>\r\n\r\n<p>Perjanjian ini merupakan keseluruhan perjanjian antara Anda dan Sospawn terkait penggunaan aplikasi oleh Anda dan menggantikan semua perjanjian tertulis atau lisan sebelumnya dan pada saat yang sama antara Anda dan Sospawn.</p>\r\n\r\n<p>Anda mungkin tunduk pada syarat dan ketentuan tambahan yang berlaku saat Anda menggunakan atau membeli layanan Sospawn lain, yang akan disediakan Sospawn kepada Anda pada saat penggunaan atau pembelian tersebut.</p>\r\n\r\n<h4>Pembaruan Ketentuan Kami</h4>\r\n\r\n<p>Kami dapat mengubah Layanan dan kebijakan kami, dan kami mungkin perlu melakukan perubahan pada Persyaratan ini agar Persyaratan tersebut mencerminkan Layanan dan kebijakan kami secara akurat. Kecuali jika diwajibkan oleh undang-undang, kami akan memberi tahu Anda (misalnya, melalui Layanan kami) sebelum kami membuat perubahan pada Ketentuan ini dan memberi Anda kesempatan untuk meninjaunya sebelum berlaku. Kemudian, jika Anda terus menggunakan Layanan, Anda akan terikat dengan Ketentuan yang diperbarui. Jika Anda tidak ingin menyetujui Persyaratan ini atau yang diperbarui, Anda dapat menghapus akun Anda.</p>\r\n\r\n<h4>Kekayaan Intelektual</h4>\r\n\r\n<p>Aplikasi dan seluruh konten, fitur, dan fungsinya (termasuk namun tidak terbatas pada semua informasi, perangkat lunak, teks, tampilan, gambar, video, dan audio, serta desain, pemilihan, dan pengaturannya), dimiliki oleh Sospawn, miliknya pemberi lisensi atau penyedia lain dari materi tersebut dan dilindungi oleh ID dan hak cipta internasional, merek dagang, paten, rahasia dagang, dan undang-undang kekayaan intelektual atau hak kepemilikan lainnya. Materi tidak boleh disalin, dimodifikasi, direproduksi, diunduh atau didistribusikan dengan cara apa pun, seluruhnya atau sebagian, tanpa izin tertulis sebelumnya dari Sospawn, kecuali dan kecuali secara tegas disediakan dalam Syarat &amp; Ketentuan ini. Setiap penggunaan materi yang tidak sah dilarang.</p>\r\n\r\n<h4>Perjanjian Arbitrase</h4>\r\n\r\n<p>Bagian ini berlaku untuk sengketa apa pun KECUALI TIDAK TERMASUK SENGKETA YANG BERKAITAN DENGAN KLAIM UNTUK PEMBEBASAN YANG SETARA ATAU YANG SETARA TENTANG PENEGAKAN ATAU VALIDITAS HAK KEKAYAAN INTELEKTUAL ANDA ATAU Sospawn. Istilah &quot;perselisihan&quot; berarti setiap perselisihan, tindakan, atau kontroversi lain antara Anda dan Sospawn mengenai Layanan atau perjanjian ini, baik dalam kontrak, jaminan, kesalahan, undang-undang, peraturan, tata cara, atau dasar hukum atau kesetaraan lainnya. &ldquo;Sengketa&rdquo; akan diberikan arti seluas mungkin yang diperbolehkan menurut hukum.</p>\r\n\r\n<h4>Pemberitahuan Sengketa</h4>\r\n\r\n<p>Jika terjadi perselisihan, Anda atau Sospawn harus memberikan Pemberitahuan Sengketa kepada pihak lain, yaitu pernyataan tertulis yang mencantumkan nama, alamat, dan informasi kontak pihak yang memberikannya, fakta yang menimbulkan perselisihan sengketa, dan keringanan yang diminta. Anda harus mengirimkan Pemberitahuan Sengketa melalui email ke:&nbsp;<a class=\"__cf_email__\" data-cfemail=\"25465665564a565544524b0b5d5c5f0b\" href=\"/cdn-cgi/l/email-protection\">[email&nbsp;protected]</a> Sospawn akan mengirimkan Pemberitahuan Sengketa apa pun kepada Anda melalui surat ke alamat Anda jika kami memilikinya, atau sebaliknya ke alamat email Anda. Anda dan Sospawn akan berusaha untuk menyelesaikan sengketa apa pun melalui negosiasi informal dalam waktu enam puluh (60) hari sejak tanggal Pengiriman Pemberitahuan Sengketa. Setelah enam puluh (60) hari, Anda atau Sospawn dapat memulai arbitrase.</p>\r\n\r\n<h4>Arbitrase yang Mengikat</h4>\r\n\r\n<p>Jika Anda dan Sospawn tidak menyelesaikan sengketa apa pun melalui negosiasi informal, upaya lain apa pun untuk menyelesaikan sengketa tersebut akan dilakukan secara eksklusif melalui arbitrase yang mengikat seperti yang dijelaskan di bagian ini. Anda melepaskan hak untuk melakukan litigasi (atau berpartisipasi sebagai pihak atau anggota kelompok) semua perselisihan di pengadilan di hadapan hakim atau juri. Sengketa tersebut akan diselesaikan dengan arbitrase yang mengikat sesuai dengan aturan arbitrase komersial dari Asosiasi Arbitrase Amerika. Salah satu pihak dapat meminta ganti rugi sementara atau sementara dari pengadilan mana pun dengan yurisdiksi yang kompeten, sebagaimana diperlukan untuk melindungi hak atau properti pihak tersebut sambil menunggu penyelesaian arbitrase. Setiap dan semua biaya, biaya, dan pengeluaran hukum, akuntansi, dan lainnya yang dikeluarkan oleh pihak yang menang akan ditanggung oleh pihak yang tidak menang.</p>\r\n\r\n<h4>Pengiriman dan Privasi</h4>\r\n\r\n<p>Jika Anda mengirimkan atau memposting ide, saran kreatif, desain, foto, informasi, iklan, data, atau proposal apa pun, termasuk ide untuk produk, layanan, fitur, teknologi, atau promosi baru atau yang lebih baik, Anda secara tegas setuju bahwa kiriman akan secara otomatis diperlakukan sebagai non-rahasia dan non-hak milik dan akan menjadi satu-satunya milik Sospawn tanpa kompensasi atau kredit apa pun kepada Anda. Sospawn dan afiliasinya tidak memiliki kewajiban sehubungan dengan kiriman atau kiriman tersebut dan dapat menggunakan ide yang terkandung dalam kiriman atau kiriman tersebut untuk tujuan apa pun di media apa pun selamanya, termasuk, namun tidak terbatas pada, pengembangan, pembuatan, dan pemasaran produk dan layanan menggunakan ide tersebut.</p>\r\n\r\n<h4>Promosi</h4>\r\n\r\n<p>Sospawn dapat, dari waktu ke waktu, menyertakan kontes, promosi, undian, atau aktivitas lain (&ldquo;Promosi&rdquo;) yang mengharuskan Anda mengirimkan materi atau informasi tentang diri Anda. Harap perhatikan bahwa semua Promosi mungkin diatur oleh aturan terpisah yang mungkin berisi persyaratan kelayakan tertentu, seperti batasan usia dan lokasi geografis. Anda bertanggung jawab untuk membaca semua aturan Promosi untuk menentukan apakah Anda memenuhi syarat untuk berpartisipasi atau tidak. Jika Anda mengikuti Promosi apa pun, Anda setuju untuk mematuhi dan mematuhi semua Aturan Promosi.</p>\r\n\r\n<p>Syarat dan ketentuan tambahan mungkin berlaku untuk pembelian barang atau layanan pada atau melalui Layanan, yang syarat dan ketentuannya dijadikan bagian dari Perjanjian ini dengan referensi ini.</p>\r\n\r\n<h4>Kesalahan Tipografi</h4>\r\n\r\n<p>Jika produk dan/atau layanan terdaftar dengan harga yang salah atau dengan informasi yang salah karena kesalahan ketik, kami berhak menolak atau membatalkan pesanan apa pun yang dilakukan untuk produk dan/atau layanan yang terdaftar di harga yang salah harga. Kami berhak untuk menolak atau membatalkan pesanan tersebut apakah pesanan telah dikonfirmasi atau tidak dan kartu kredit Anda dibebankan. Jika kartu kredit Anda telah ditagih untuk pembelian dan pesanan Anda dibatalkan, kami akan segera mengeluarkan kredit ke rekening kartu kredit Anda atau rekening pembayaran lain sejumlah tagihan.</p>\r\n\r\n<h4>Lain-lain</h4>\r\n\r\n<p>Jika karena alasan apa pun pengadilan dari yurisdiksi yang kompeten menemukan ketentuan atau bagian mana pun dari Persyaratan &amp; Ketentuan ini tidak dapat dilaksanakan, bagian lain dari Persyaratan &amp; Ketentuan ini akan terus berlaku dan memiliki kekuatan penuh. Pengesampingan apa pun dari ketentuan apa pun dari Syarat &amp; Ketentuan ini akan berlaku hanya jika secara tertulis dan ditandatangani oleh perwakilan resmi Sospawn. Sospawn akan berhak atas putusan sela atau ganti rugi lainnya yang adil (tanpa kewajiban memposting jaminan atau jaminan apa pun) jika terjadi pelanggaran atau pelanggaran antisipatif oleh Anda. Sospawn mengoperasikan dan mengendalikan Layanan Sospawn dari kantornya di ID. Layanan tidak dimaksudkan untuk didistribusikan atau digunakan oleh orang atau entitas mana pun di yurisdiksi atau negara mana pun di mana distribusi atau penggunaan tersebut akan bertentangan dengan hukum atau peraturan. Oleh karena itu, orang-orang yang memilih untuk mengakses Layanan Sospawn dari lokasi lain melakukannya atas inisiatif mereka sendiri dan sepenuhnya bertanggung jawab untuk mematuhi undang-undang setempat, jika dan sejauh undang-undang setempat berlaku. Syarat &amp; Ketentuan ini (yang mencakup dan menggabungkan Kebijakan Privasi Sospawn) berisi seluruh pemahaman, dan menggantikan semua pemahaman sebelumnya, antara Anda dan Sospawn mengenai pokok bahasannya, dan tidak dapat diubah atau dimodifikasi oleh Anda. Judul bagian yang digunakan dalam Perjanjian ini hanya untuk kenyamanan dan tidak akan diberikan impor legal apa pun.</p>\r\n\r\n<h4>Penafian</h4>\r\n\r\n<p>Sospawn tidak bertanggung jawab atas konten, kode, atau ketidaktepatan apa pun lainnya.</p>\r\n\r\n<p>Sospawn tidak memberikan jaminan atau garansi.</p>\r\n\r\n<p>Dalam keadaan apa pun Sospawn tidak akan bertanggung jawab atas kerusakan khusus, langsung, tidak langsung, konsekuensial, atau insidental atau kerusakan apa pun, baik dalam tindakan kontrak, kelalaian, atau kerugian lainnya, yang timbul dari atau sehubungan dengan penggunaan Layanan atau konten Layanan. Perusahaan berhak untuk menambah, menghapus, atau memodifikasi konten pada Layanan kapan saja tanpa pemberitahuan sebelumnya.</p>\r\n\r\n<p>Layanan Sospawn dan kontennya disediakan &quot;sebagaimana adanya&quot; dan &quot;sebagaimana tersedia&quot; tanpa jaminan atau representasi apa pun, baik tersurat maupun tersirat. Sospawn adalah distributor dan bukan penerbit konten yang disediakan oleh pihak ketiga; dengan demikian, Sospawn tidak melakukan kontrol editorial atas konten tersebut dan tidak memberikan jaminan atau pernyataan mengenai keakuratan, keandalan, atau mata uang dari setiap informasi, konten, layanan, atau barang dagangan yang disediakan melalui atau dapat diakses melalui Layanan Sospawn. Tanpa membatasi hal tersebut di atas, Sospawn secara khusus menafikan semua jaminan dan representasi dalam konten apa pun yang dikirimkan pada atau sehubungan dengan Layanan Sospawn atau di situs yang mungkin muncul sebagai tautan pada Layanan Sospawn, atau dalam produk yang disediakan sebagai bagian dari, atau sebaliknya dalam sehubungan dengan, Layanan Sospawn, termasuk namun tidak terbatas pada jaminan apa pun yang dapat diperjualbelikan, kesesuaian untuk tujuan tertentu, atau non-pelanggaran hak pihak ketiga. Tidak ada nasihat lisan atau informasi tertulis yang diberikan oleh Sospawn atau afiliasinya, karyawan, pejabat, direktur, agen, atau sejenisnya yang akan menciptakan jaminan. Informasi harga dan ketersediaan dapat berubah tanpa pemberitahuan. Tanpa membatasi hal tersebut di atas, Sospawn tidak menjamin bahwa Layanan Sospawn tidak akan terganggu, tidak rusak, tepat waktu, atau bebas dari kesalahan.</p>\r\n\r\n<h4>Hubungi Kami</h4>\r\n\r\n<p>Jangan ragu untuk menghubungi kami jika Anda memiliki pertanyaan.</p>\r\n\r\n<ul>\r\n	<li>Melalui Email: <strong><a href=\"mailto:cs@sospawn.xyz?subject=Customer%20Support&amp;body=Hello%20Sospawn%20!\">cs@sospawn.xyz</a></strong></li>\r\n	<li>Melalui Alamat : Plaza Mutiara, Jl. DR. Ide Anak Agung Gde Agung No.5, RT.5/RW.2, Kuningan, Tim Kuningan, Kecamatan Setiabudi, Kota Jakarta Selatan, Daerah Khusus Ibukota Jakarta 12950</li>\r\n</ul>\r\n',	3000,	5000,	0.05,	80,	0,	500,	3000,	1000,	0,	5,	2,	10000);
